import axios from "axios";
import { useNavigate } from "react-router-dom";
import useFetch from "../../hooks/useFetch";
import "./propertyList.css";

const PropertyList = () => {
  const navigate = useNavigate();
  const { data, loading } = useFetch(
    "https://booky-web-app.herokuapp.com/api/hotels/countByType"
  );

  const handleClick = async (type) => {
    try {
      const { data } = await axios.get(
        `https://booky-web-app.herokuapp.com/api/hotels?type=${type}`
      );
      navigate("/hotels/category", { state: data });
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <>
      {loading ? (
        "Loading..."
      ) : (
        <div className="propertyList">
          <div className="proprtyListItem" onClick={() => handleClick("hotel")}>
            <img
              src="data:image/jpeg;base64,"
              alt="hotel"
            />
            <div className="propertyListTexts">
              <h2>{data[0]?.type}</h2>
              <span>{`${data[0]?.count} ${data[0]?.type}s`}</span>
            </div>
          </div>
          <div
            className="proprtyListItem"
            onClick={() => handleClick("apartment")}
          >
            <img
              src="data:image/jpeg;base64,"
              alt="apartment"
            />
            <div className="propertyListTexts">
              <h2>{data[1]?.type}</h2>
              <span>{`${data[1]?.count} ${data[1]?.type}s`}</span>
            </div>
          </div>
          <div
            className="proprtyListItem"
            onClick={() => handleClick("resort")}
          >
            <img
              src="data:image/jpeg;base64,"
              alt="resort"
            />
            <div className="propertyListTexts">
              <h2>{data[2]?.type}</h2>
              <span>{`${data[2]?.count} ${data[2]?.type}s`}</span>
            </div>
          </div>
          <div className="proprtyListItem" onClick={() => handleClick("villa")}>
            <img
              src="data:image/jpeg;base64,"
              alt="villa"
            />
            <div className="propertyListTexts">
              <h2>{data[3]?.type}</h2>
              <span>{`${data[3]?.count} ${data[3]?.type}s`}</span>
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default PropertyList;
